import React, { useState, useEffect } from 'react';
import { mockTransactions } from './../../mockData'; // Import mock data
import './../customer/css/DashboardPage.css'; // Add custom styles
import Notification from './../../Notification'; // Import the Notification component
import Navbar from '../../components/Navbar';

function DashboardPage() {
  const [transactions, setTransactions] = useState(mockTransactions);
  const [newTransaction, setNewTransaction] = useState({
    amount: '',
    currency: '',
    provider: 'SWIFT',
    accountNumber: '',
    swiftCode: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Fetch transaction history (ideally from the backend)
  useEffect(() => {
    fetch('http://localhost:5000/api/customers/transactions', {
      method: 'GET',
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('token')}`,
      },
    })
      .then(response => response.json())
      .then(data => setTransactions(data))
      .catch(err => console.error(err));
  }, []);

  // Handle input changes for new transaction form
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewTransaction(prev => ({
      ...prev,
      [name]: value,
    }));
  };

  // Handle form submission for new payment
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch('http://localhost:5000/api/customers/transactions', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('token')}`,
        },
        body: JSON.stringify(newTransaction),
      });

      if (response.ok) {
        const transaction = await response.json();
        setTransactions([transaction, ...transactions]);
        setSuccess('Transaction submitted successfully');
        setError('');
        setNewTransaction({
          amount: '',
          currency: '',
          provider: 'SWIFT',
          accountNumber: '',
          swiftCode: '',
        });
      } else {
        const error = await response.json();
        setError(error.message || 'Transaction failed');
        setSuccess('');
      }
    } catch (err) {
      console.error(err);
      setError('Something went wrong.');
      setSuccess('');
    }
  };

  return (
    <>
      <Navbar userType="Customer" />
      <div className="dashboard-container">
        <h2>Customer Dashboard</h2>

        {/* Display Success or Error Notifications */}
        {success && <Notification message={success} type="success" />}
        {error && <Notification message={error} type="error" />}

        {/* Transaction History */}
        <h3>Transaction History</h3>
        <table>
          <thead>
            <tr>
              <th>Amount</th>
              <th>Currency</th>
              <th>Provider</th>
              <th>Account Number</th>
              <th>SWIFT Code</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {transactions.length === 0 ? (
              <tr><td colSpan="6">No transactions found.</td></tr>
            ) : (
              transactions.map((tx, index) => (
                <tr key={index}>
                  <td>{tx.amount}</td>
                  <td>{tx.currency}</td>
                  <td>{tx.provider}</td>
                  <td>{tx.accountNumber}</td>
                  <td>{tx.swiftCode}</td>
                  <td>{tx.status}</td>
                </tr>
              ))
            )}
          </tbody>
        </table>

        {/* New Transaction Form */}
        <h3>Initiate a New Payment</h3>
        <form onSubmit={handleSubmit}>
          <div>
            <label>Amount:</label>
            <input
              type="number"
              name="amount"
              value={newTransaction.amount}
              onChange={handleInputChange}
              required
            />
          </div>

          <div>
            <label>Currency:</label>
            <input
              type="text"
              name="currency"
              value={newTransaction.currency}
              onChange={handleInputChange}
              required
            />
          </div>

          <div>
            <label>Provider:</label>
            <select
              name="provider"
              value={newTransaction.provider}
              onChange={handleInputChange}
              required
            >
              <option value="SWIFT">SWIFT</option>
              {/* Add more options if needed */}
            </select>
          </div>

          <div>
            <label>Account Number:</label>
            <input
              type="text"
              name="accountNumber"
              value={newTransaction.accountNumber}
              onChange={handleInputChange}
              required
            />
          </div>

          <div>
            <label>SWIFT Code:</label>
            <input
              type="text"
              name="swiftCode"
              value={newTransaction.swiftCode}
              onChange={handleInputChange}
              required
            />
          </div>

          <button type="submit">Pay Now</button>
        </form>
      </div>
    </>
  );
}

export default DashboardPage;
